text:
介紹及分享各位鄉親~
《酪梨芒果》新品種!!
mangga alpukat《酪梨/芒果》

 @mangga alpukat《猛甲《台語發音》《阿布卡特》《芒果/酪梨》
@場主命名：扭蛋芒果品種//特點如下
@「酪梨芒果」是綠皮。
@果實(皮薄)切開後，果肉(無纖維) (核小肉厚)(鮮甜多汁)(更有芒果香氣)。。
@此種果實，跟一般芒果吃法不同、從中段劃一圈，《扭轉開》果實，分成兩半，果實種子留在另一半上 用湯匙挖取後食用《不沾手》，也像酪梨 ，在印尼稱之為《酪梨芒果》
，有人問《究竟是酪梨/還是芒果》?故場主稱之為稱:扭蛋芒果，非常有趣，平均果重約600公克。
@扭蛋芒果，在臺灣東部(每年1-2月開花，約7-8月採果)，種植後隔年即可產果，甜度約18度。

 酪梨芒果~究竟~什麼滋味~
@味道:接近黑香芒果，又帶有桂花的香味。
@果肉:幾乎無纖維《只有接近種子處有少許》
@果皮:青皮《起匙不易破》
果重:在印尼平均果重約600公克
@儲存:採摘後可放約15天《候熟》
@套袋:建議《牛皮紙袋》
@果實越軟越香甜:無酸味，肉質細緻，芬芳
植物性狀：抗病性強，果皮韌性《起匙不易破皮》綠皮
#大發種苗場
